import '../App.css';

const Topnav = () => {
    return (
        <div>
            <ul className='topnav'>
                <li className='topnav-list-item'><a className='topnav-link' href="default.asp">Home</a></li>
                <li className='topnav-list-item'><a className='topnav-link' href="news.asp">News</a></li>
                <li className='topnav-list-item'><a className='topnav-link' href="contact.asp">Contact</a></li>
                <li className='topnav-list-item'><a className='topnav-link' href="about.asp">About</a></li>
                <li style="float:right"><a class="active" href="#about">About</a></li>
            </ul>
        </div >
    )
};

export default Topnav;
